import React from "react";
import "./Operadores.css";

function Operadores() {

    const operar = (op) => {
        switch (op) {
            case '+':
            case '-':
            case 'x':
            case '/':
            case 'CE':
            case '=':
        }
    }

    return (
        <div className="contain-operadores">
            <div><button
            onClick={() => operar('+')}
            >+</button></div>
            <div><button
            onClick={() => operar('-')}
            >-</button></div>
            <div><button
            onClick={() => operar('x')}
            >x</button></div>
            <div><button
            onClick={() => operar('/')}
            >/</button></div>
            <div><button
            onClick={() => operar('CE')}
            >CE</button></div>
            <div><button
            onClick={() => operar('=')}
            >=</button></div>
        </div>
    );
}

export { Operadores };
